import React, { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css'; 
import "./Home.css";

function Home() {
  useEffect(() => {
    AOS.init({
      duration: 800,
      once: true,
      easing: 'ease-out'
    });
  }, []);

  return (
    <div className="home-container">
      {/* Hero Section */}
      <section className="home-section">
        <div className="title-section">
          <div className="hero-content" data-aos="fade-up" data-aos-delay="500">
            <h1 className="main-title">
              <span className="rush">RUSH</span>
              <span className="room">
                ROOM<span className="dot">.</span>
              </span>
            </h1>
            <p className="subtitle">Find Your Comfort, Anywhere</p>
          </div>
        </div>
      </section>

      {/* Overview Section */}
      <section className="overview-section" data-aos="fade-up">
        <div className="overview-content">
          <h2 className="overview-title">
            About <span className="highlight">RushRoom</span>
          </h2>
          <p className="overview-text">
            RushRoom helps you locate <span className="bold">clean</span>, <span className="bold">accessible</span>, 
            and <span className="bold">convenient</span> restrooms wherever you go.  
            Say goodbye to the stress of searching for a restroom in unfamiliar places.  
            With <span className="highlight">real-time data</span>, <span className="highlight">user reviews</span>, and a  
            <span className="highlight"> community-driven</span> approach, we make restroom discovery <span className="bold">easier than ever.</span>
          </p>
        </div>
      </section>
    </div>
  );
}

export default Home;
